import React from 'react'
import I18n from '../I18n';

function Home() {
  return (
    <div className="App">
    <header className="App-header">
      <h1>Hola spy Home</h1>
      <h1><I18n t="home" /></h1>
    </header>
  </div>
  )
}

export default Home
